import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { NavegacionComponent } from './componentes/navegacion/navegacion.component';
import { InstitucionalComponent } from './componentes/institucional/institucional.component';
import { HomeComponent } from './componentes/home/home.component';
import { AdministradorComponent } from './componentes/administrador/administrador.component';
import { ConsultarLibrosComponent } from './componetes/consultar-libros/consultar-libros.component';
import { ReservarLibrosComponent } from './componentes/reservar-libros/reservar-libros.component';
import { RegistrarseComponent } from './componentes/registrarse/registrarse.component';
import { IngresarComponent } from './componentes/ingresar/ingresar.component';

import { PerfilComponent } from './componetes/perfil/perfil.component';

@NgModule({
  declarations: [
    AppComponent,
    NavegacionComponent,
    InstitucionalComponent,
    HomeComponent,
    AdministradorComponent,
    ConsultarLibrosComponent,
    ReservarLibrosComponent,
    RegistrarseComponent,
    IngresarComponent,
    MultasComponent,
    PerfilComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
